import { useEffect, useState } from "react";
import axios from "axios";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";
import "leaflet/dist/leaflet.css";
import { Line, Bar } from "react-chartjs-2";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  BarElement,
  Title,
  Tooltip,
  Legend,
} from "chart.js";
import L from "leaflet";

// Fix for missing Leaflet marker icons
import markerIcon2x from "leaflet/dist/images/marker-icon-2x.png";
import markerIcon from "leaflet/dist/images/marker-icon.png";
import markerShadow from "leaflet/dist/images/marker-shadow.png";

delete L.Icon.Default.prototype._getIconUrl;
L.Icon.Default.mergeOptions({
  iconRetinaUrl: markerIcon2x,
  iconUrl: markerIcon,
  shadowUrl: markerShadow,
});

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  BarElement,
  Title,
  Tooltip,
  Legend
);

function App() {
  const [buoys, setBuoys] = useState([]);
  const [selectedBuoy, setSelectedBuoy] = useState(null);
  const [stats, setStats] = useState({
    totalBuoys: 0,
    activeBuoys: 0,
    recentData: 0,
    avgTemperature: 0
  });
  const [networks, setNetworks] = useState({ OMNI: 0, RAMA: 0 });
  const [loading, setLoading] = useState(false);
  const [selectedYear, setSelectedYear] = useState(new Date().getFullYear());
  const [yearRange, setYearRange] = useState([]);
  const [realTimeMode, setRealTimeMode] = useState(false);

  useEffect(() => {
    const currentYear = new Date().getFullYear();
    const years = [];
    for (let year = 2012; year <= currentYear; year++) {
      years.push(year);
    }
    setYearRange(years.reverse());
  }, []);

  // Fetch ocean buoys data
  useEffect(() => {
    axios.get("http://localhost:5000/api/ocean-buoys").then((res) => {
      if (res.data.success) {
        setBuoys(res.data.buoys);
        setStats(res.data.stats);
        setNetworks(res.data.networks);
      }
    }).catch(err => {
      console.error("Error fetching buoys:", err);
    });
  }, []);

  // Real-time data updates
  useEffect(() => {
    if (!realTimeMode || !selectedBuoy) return;

    const interval = setInterval(() => {
      axios.get(`http://localhost:5000/api/realtime-data/${selectedBuoy.id}`)
        .then(res => {
          if (res.data.success) {
            setSelectedBuoy(res.data.data.data);
          }
        })
        .catch(err => console.error("Real-time update error:", err));
    }, 30000); // Update every 30 seconds

    return () => clearInterval(interval);
  }, [realTimeMode, selectedBuoy]);

  // Fetch buoy details
  const fetchBuoyDetails = async (buoyId) => {
    setLoading(true);
    try {
      const res = await axios.get(`http://localhost:5000/api/ocean-buoy/${buoyId}`);
      if (res.data.success) {
        setSelectedBuoy(res.data.data);
      }
    } catch (err) {
      console.error("Error fetching buoy details:", err);
    }
    setLoading(false);
  };

  // Download CSV data
  const downloadCSV = async () => {
    try {
      const response = await axios.get(`http://localhost:5000/api/ocean-data-csv/${selectedYear}`, {
        responseType: 'blob'
      });

      const blob = new Blob([response.data], { type: 'text/csv' });
      const url = window.URL.createObjectURL(blob);
      const link = document.createElement('a');
      link.href = url;
      link.setAttribute('download', `incois_ocean_data_${selectedYear}.csv`);
      document.body.appendChild(link);
      link.click();
      link.remove();
      window.URL.revokeObjectURL(url);
    } catch (err) {
      console.error("Error downloading CSV:", err);
      alert("Error downloading CSV data");
    }
  };

  // Create temperature profile chart
  const tempChartData = selectedBuoy && selectedBuoy.temperatureProfile ? {
    labels: selectedBuoy.temperatureProfile.depths.map(d => `${d}m`),
    datasets: [{
      label: 'Temperature (Â°C)',
      data: selectedBuoy.temperatureProfile.temperatures,
      borderColor: '#ef4444',
      backgroundColor: 'rgba(239, 68, 68, 0.1)',
      tension: 0.4,
      fill: true,
    }]
  } : null;

  // Create salinity profile chart
  const salinityChartData = selectedBuoy && selectedBuoy.salinityProfile ? {
    labels: selectedBuoy.salinityProfile.depths.map(d => `${d}m`),
    datasets: [{
      label: 'Salinity (PSU)',
      data: selectedBuoy.salinityProfile.salinity,
      borderColor: '#3b82f6',
      backgroundColor: 'rgba(59, 130, 246, 0.1)',
      tension: 0.4,
      fill: true,
    }]
  } : null;

  // Create custom buoy icons
  const omniIcon = new L.Icon({
    iconUrl: 'data:image/svg+xml;base64,' + btoa(`
      <svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
        <circle cx="12" cy="12" r="8" fill="#0ea5e9" stroke="#ffffff" stroke-width="2"/>
        <text x="12" y="16" text-anchor="middle" fill="white" font-size="8" font-weight="bold">O</text>
      </svg>
    `),
    iconSize: [24, 24],
    iconAnchor: [12, 12],
    popupAnchor: [0, -12]
  });

  const ramaIcon = new L.Icon({
    iconUrl: 'data:image/svg+xml;base64,' + btoa(`
      <svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
        <circle cx="12" cy="12" r="8" fill="#10b981" stroke="#ffffff" stroke-width="2"/>
        <text x="12" y="16" text-anchor="middle" fill="white" font-size="8" font-weight="bold">R</text>
      </svg>
    `),
    iconSize: [24, 24],
    iconAnchor: [12, 12],
    popupAnchor: [0, -12]
  });

  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-900 via-blue-700 to-cyan-500 text-white">
      {/* Header */}
      <header className="p-6 text-center bg-gradient-to-r from-blue-600 via-cyan-500 to-blue-600 text-white font-extrabold text-3xl shadow-xl tracking-wide">
        ð INCOIS Ocean Observation Network Dashboard
      </header>

      {/* Stats Dashboard */}
      <div className="grid grid-cols-2 md:grid-cols-5 gap-4 p-6">
        <div className="stat-card">
          <h2 className="text-lg text-gray-100">Active Buoys</h2>
          <p className="text-3xl font-bold text-green-400">{stats.activeBuoys}</p>
        </div>
        <div className="stat-card">
          <h2 className="text-lg text-gray-100">Total Buoys</h2>
          <p className="text-3xl font-bold text-blue-400">{stats.totalBuoys}</p>
        </div>
        <div className="stat-card">
          <h2 className="text-lg text-gray-100">Recent Data</h2>
          <p className="text-3xl font-bold text-yellow-400">{stats.recentData}</p>
        </div>
        <div className="stat-card">
          <h2 className="text-lg text-gray-100">Avg Temp</h2>
          <p className="text-3xl font-bold text-orange-400">{stats.avgTemperature}Â°C</p>
        </div>
        <div className="stat-card">
          <h2 className="text-lg text-gray-100">Networks</h2>
          <div className="text-sm">
            <p className="text-blue-300">OMNI: {networks.OMNI}</p>
            <p className="text-green-300">RAMA: {networks.RAMA}</p>
          </div>
        </div>
      </div>

      {/* Controls */}
      <div className="px-6 mb-6">
        <div className="glass-morphism rounded-2xl p-6 shadow-lg">
          <div className="flex flex-col md:flex-row items-center justify-between gap-4">
            <div className="flex items-center gap-4">
              <h3 className="text-xl font-semibold">Data Controls</h3>
              <button
                onClick={() => setRealTimeMode(!realTimeMode)}
                className={`px-4 py-2 rounded-lg font-semibold transition-all ${
                  realTimeMode 
                    ? 'bg-green-500 hover:bg-green-600' 
                    : 'bg-gray-500 hover:bg-gray-600'
                }`}
              >
                {realTimeMode ? 'ð¢ Real-Time ON' : 'âª Real-Time OFF'}
              </button>
            </div>
            <div className="flex items-center gap-4">
              <select
                value={selectedYear}
                onChange={(e) => setSelectedYear(parseInt(e.target.value))}
                className="px-4 py-2 rounded-lg bg-white/10 border border-white/30 text-white backdrop-blur-sm focus:outline-none focus:ring-2 focus:ring-blue-400"
              >
                {yearRange.map(year => (
                  <option key={year} value={year} className="bg-blue-800">
                    {year}
                  </option>
                ))}
              </select>
              <button
                onClick={downloadCSV}
                className="btn-success"
              >
                ð¥ Download CSV
              </button>
            </div>
          </div>
        </div>
      </div>

      {/* Main Layout */}
      <div className="grid grid-cols-1 lg:grid-cols-2 gap-6 p-6">
        {/* Map */}
        <div className="glass-morphism rounded-2xl shadow-xl overflow-hidden">
          <div className="p-4 bg-white/10 border-b border-white/20">
            <h3 className="text-lg font-semibold">ðºï¸ Ocean Buoy Locations</h3>
            <div className="flex gap-4 mt-2 text-sm">
              <span className="flex items-center gap-1">
                <span className="w-3 h-3 bg-blue-500 rounded-full"></span>
                OMNI Buoys
              </span>
              <span className="flex items-center gap-1">
                <span className="w-3 h-3 bg-green-500 rounded-full"></span>
                RAMA Buoys
              </span>
            </div>
          </div>
          <MapContainer
            center={[12, 77]}
            zoom={5}
            style={{ height: "500px", width: "100%" }}
          >
            <TileLayer
              attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a>'
              url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
            />
            {buoys.map((buoy, idx) => (
              <Marker
                key={idx}
                position={[buoy.lat, buoy.lon]}
                icon={buoy.type === 'OMNI' ? omniIcon : ramaIcon}
                eventHandlers={{
                  click: () => fetchBuoyDetails(buoy.id),
                }}
              >
                <Popup>
                  <div className="text-black">
                    <strong>{buoy.id}</strong><br/>
                    Network: {buoy.type}<br/>
                    Status: {buoy.status === 'active' ? 'ð¢ Active' : 'ð´ Inactive'}<br/>
                    SST: {buoy.parameters?.seaSurfaceTemperature}Â°C<br/>
                    Wind: {buoy.parameters?.windSpeed} m/s
                  </div>
                </Popup>
              </Marker>
            ))}
          </MapContainer>
        </div>

        {/* Buoy Details */}
        <div className="glass-morphism rounded-2xl shadow-xl">
          <div className="p-4 bg-white/10 border-b border-white/20 flex justify-between items-center">
            <h3 className="text-lg font-semibold">ð Buoy Data Analysis</h3>
            {realTimeMode && selectedBuoy && (
              <span className="text-green-400 text-sm animate-pulse">ð´ LIVE</span>
            )}
          </div>
          <div className="p-6 max-h-[600px] overflow-y-auto">
            {loading ? (
              <div className="text-center py-8">
                <div className="animate-spin rounded-full h-8 w-8 border-b-2 border-white mx-auto"></div>
                <p className="text-gray-200 mt-2">Loading buoy details...</p>
              </div>
            ) : selectedBuoy ? (
              <div className="space-y-6">
                {/* Buoy Info */}
                <div>
                  <h4 className="text-xl font-semibold mb-2 text-yellow-300">
                    {selectedBuoy.id} ({selectedBuoy.type} Network)
                  </h4>
                  <div className="grid grid-cols-2 gap-4 text-sm">
                    <p><span className="text-gray-300">Location:</span> {selectedBuoy.lat.toFixed(2)}Â°N, {selectedBuoy.lon.toFixed(2)}Â°E</p>
                    <p><span className="text-gray-300">Status:</span> 
                      <span className={selectedBuoy.status === 'active' ? 'text-green-400' : 'text-red-400'}>
                        {selectedBuoy.status === 'active' ? ' ð¢ Active' : ' ð´ Inactive'}
                      </span>
                    </p>
                  </div>
                </div>

                {/* Current Parameters */}
                <div>
                  <h5 className="text-lg font-semibold mb-3 text-cyan-300">Current Conditions</h5>
                  <div className="grid grid-cols-2 gap-3 text-sm">
                    <div className="bg-white/10 rounded-lg p-3">
                      <p className="text-gray-300">Sea Surface Temperature</p>
                      <p className="text-xl font-bold text-red-400">{selectedBuoy.parameters.seaSurfaceTemperature}Â°C</p>
                    </div>
                    <div className="bg-white/10 rounded-lg p-3">
                      <p className="text-gray-300">Salinity</p>
                      <p className="text-xl font-bold text-blue-400">{selectedBuoy.parameters.salinity} PSU</p>
                    </div>
                    <div className="bg-white/10 rounded-lg p-3">
                      <p className="text-gray-300">Wind Speed</p>
                      <p className="text-xl font-bold text-green-400">{selectedBuoy.parameters.windSpeed} m/s</p>
                    </div>
                    <div className="bg-white/10 rounded-lg p-3">
                      <p className="text-gray-300">Wave Height</p>
                      <p className="text-xl font-bold text-purple-400">{selectedBuoy.parameters.waveHeight} m</p>
                    </div>
                  </div>
                </div>

                {/* Temperature Profile */}
                {tempChartData && (
                  <div>
                    <h5 className="text-lg font-semibold mb-3 text-red-300">Temperature Profile</h5>
                    <div className="chart-container">
                      <Line
                        data={tempChartData}
                        options={{
                          responsive: true,
                          maintainAspectRatio: false,
                          plugins: { 
                            legend: { labels: { color: 'white' } },
                            title: { display: true, text: 'Temperature vs Depth', color: 'white' }
                          },
                          scales: {
                            x: { 
                              title: { display: true, text: 'Depth', color: 'white' },
                              ticks: { color: 'white' },
                              grid: { color: 'rgba(255,255,255,0.1)' }
                            },
                            y: { 
                              title: { display: true, text: 'Temperature (Â°C)', color: 'white' },
                              ticks: { color: 'white' },
                              grid: { color: 'rgba(255,255,255,0.1)' }
                            },
                          },
                        }}
                      />
                    </div>
                  </div>
                )}

                {/* Salinity Profile */}
                {salinityChartData && (
                  <div>
                    <h5 className="text-lg font-semibold mb-3 text-blue-300">Salinity Profile</h5>
                    <div className="chart-container">
                      <Line
                        data={salinityChartData}
                        options={{
                          responsive: true,
                          maintainAspectRatio: false,
                          plugins: { 
                            legend: { labels: { color: 'white' } },
                            title: { display: true, text: 'Salinity vs Depth', color: 'white' }
                          },
                          scales: {
                            x: { 
                              title: { display: true, text: 'Depth', color: 'white' },
                              ticks: { color: 'white' },
                              grid: { color: 'rgba(255,255,255,0.1)' }
                            },
                            y: { 
                              title: { display: true, text: 'Salinity (PSU)', color: 'white' },
                              ticks: { color: 'white' },
                              grid: { color: 'rgba(255,255,255,0.1)' }
                            },
                          },
                        }}
                      />
                    </div>
                  </div>
                )}
              </div>
            ) : (
              <p className="text-gray-300 text-center py-8">
                ð Click on a buoy marker to view detailed oceanographic data from INCOIS Ocean Observation Network
              </p>
            )}
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
